import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


class ArticleBox extends React.Component {
  constructor(props) {
    super(props)
    this.state = {
      value:null,
    }
  }

  render() {
    return (
      <div className = "container">
      <div className = "article_box">

      <h1> {this.props.title} </h1>
      <h2> {this.props.preview} </h2>

      </div>
      </div>
    );
  }
}

